import React, { useState, Component } from 'react'
import DatePicker from "react-datepicker";
import 'react-datepicker/dist/react-datepicker-cssmodules.css';
import "react-datepicker/dist/react-datepicker.css";
import axios from 'axios'


export default class Logs extends Component {
    constructor(props) {
        super(props)

        this.state = { startDate: new Date() }
    }
    setStartDate = (date) => {
        this.setState({startDate: date})

    }

    handleSubmit = async () => {
        var date = this.state.startDate
          const response = await axios.post('http://localhost:5000/logs', {date: date})
          console.log(response)
    }


    render() {

        return (
            <div>
                <div class="container">
                    <div class="row">
                    <div class="col-md-6 mx-auto">
                        <div class="py-4 text-center"><i class="fa fa-calendar fa-5x"></i></div>
                            <div class="form-group mb-4">
                                <div class="datepicker date input-group p-0 shadow-sm">
                                </div>
                            </div>
                            <div class="text-center">
                            <DatePicker selected={this.state.startDate} onChange={date => this.setStartDate(date)} />
                                <p class="font-italic text-muted mb-0">You're checking logs for the date</p>
                                <button onClick={this.handleSubmit} class="btn btn-primary btn-sm px-4 rounded-pill text-uppercase font-weight-bold shadow-sm">Show</button>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
